import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the shopping cart element
    const cartLocator = page.locator('div.cart');
    await cartLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Extract text from the cart element
    const cartText = await cartLocator.textContent();

    // Click the cart element to open the modal
    await cartLocator.click();

    // Take a screenshot after clicking the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_clicked.png'));

    return {
      success: true,
      action: "Clicked on the shopping cart element to open the modal.",
      extractedData: {
        cartElementText: cartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open the shopping cart modal.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
